// @ts-nocheck
export async function toggleSidebar(e="mySidebar"){try{const r=document.getElementById(e);if(!r)throw new Error(`Sidebar element not found: ${e}`);r.classList.toggle("w3-hide")}catch(e){const{AppError:r}=await import("../../errors/models/AppError.js");r.handleError(e,{errorCode:r.Types.NAVIGATION_ERROR,userMessage:"Navigation menu not available"})}}